import React, { Component } from "react";
import { connect } from "react-redux";
import Router from "next/router";
import * as routes from "./../../../reusecore/src/constants/routes";
import { AppWrapper } from "../../containers/App/app.style";
import { AppWithAuthorization } from "./../../containers/App";
import { ReactTypeformEmbed } from 'react-typeform-embed';

class Form extends Component {
  render() {

    return (
      <AppWithAuthorization>
        <AppWrapper>
          <ReactTypeformEmbed
            hideFooter={true}
            onSubmit={() => Router.push(routes.HOME)}
            url="https://dhakon.typeform.com/to/A7bW0z" />
        </AppWrapper>
      </AppWithAuthorization>
    );
  }
}

const mapStateToProps = state => ({
  authUser: state.sessionState.authUser
});

export default connect(mapStateToProps)(Form);
